import React from "react";
import Card from "./card.jsx";

const ListCards = ({ robots }) => {
  const robotsComponent = robots.map((user, i) => {
    return <Card id={user[0].id} name={user[0].name} email={user[i].email} />;
  });

  return <div>{robotsComponent}</div>;

  //   return <div> {robotsComponent}</div>;
};

export default ListCards;
